import React from "react"; 
import { Link } from "react-router-dom"

const MenuActividades = () => {
    return(
        <nav>            
            <Link to="/src/views/Campismo.jsx">Campismo</Link>
            <Link to="/src/views//escalada">Escalada</Link>
            <Link to="/rappel">Rappel</Link>                       
        </nav>
    );
};

export default MenuActividades;
